import React from "react";
import "./Navigacija.css";
import { Link } from "react-router-dom";

const Navigacija = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Naslovna</Link>
        </li>
        <li>
          <Link to="/prijava">Prijava</Link>
        </li>
        <li>
          <Link to="/registracija">Registracija</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navigacija;
